import React from 'react';
import { Container, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const LandingPage = () => {
  const whiteTextStyle = { color: '#FFFFFF' };

  return (
    <Container maxWidth="md" style={{ textAlign: 'center', marginTop: '100px' }}>
      <Typography variant="h3" gutterBottom style={whiteTextStyle}>
        Welcome to Our Landing Page
      </Typography>
      <Typography variant="h5" paragraph style={whiteTextStyle}>
        Discover amazing content and features.
      </Typography>
      <Button variant="contained" color="primary">
        <Link to="/user-list" style={{ textDecoration: 'none', ...whiteTextStyle }}>
          Get Started
        </Link>
      </Button>
    </Container>
  );
};

export default LandingPage;
